class Wild_pokemon():
    def __init__(self, level, species):
        build = pokemon_build_data[species]
        self.types = build['types']
        self.catch_rate = build['catch_rate']
        self.front_pic = build['front_pic']
        self.back_pic = build['back_pic']
        self.level_1_learnset = build['level_1_learnset']
        self.growth_rate = build['growth_rate']
        self.tmhm_learnset = build['tmhm_learnset']
        self.name = build['name'].title()
        self.species = build['name']
        self.hp, self.attack, self.defense, self.speed, self.special = build['base_stats']
        self.ev = 0
        self.level = level
        self.evolution_level = build['evolution_level']
        self.evolves_to = build['evolves_to']
        self.held_item = False
        self. next_level_exp = self.find_next_level_exp()
        self.hp_iv = random.choice(list(range(1,31)))
        self.attack_iv = random.choice(list(range(1,31)))
        self.defense_iv = random.choice(list(range(1,31)))
        self.speed_iv = random.choice(list(range(1,31)))
        self.special_iv = random.choice(list(range(1,31)))
        self.exp = self.starting_exp()
        self.sex = random.choice(['Male', 'Female'])
    
    def load_starting_data(self):
        for lvl in range(1, self.level + 1):
            self.hp = int((((self.hp + self.hp_iv) * 2 + (self.ev / 4)) * lvl / 100) + 5)
            self.attack = int((((self.attack + self.attack_iv) * 2 + (self.ev / 4)) * lvl / 100) + 5)
            self.defense = int((((self.defense + self.defense_iv) * 2 + (self.ev / 4)) * lvl / 100) + 5)
            self.speed = int((((self.speed + self.speed_iv) * 2 + (self.ev / 4)) * lvl / 100) + 5)
            self.special = int((((self.special + self.special_iv) * 2 + (self.ev / 4)) * lvl / 100) + 5)

    def starting_exp(self):
        for i in range(1, self.level + 1):
            if self.growth_rate == 'GROWTH_FAST':
                next_level_exp = int(0.8 * (i) ** 3)
            elif self.growth_rate == 'GROWTH_MEDIUM_FAST':
                next_level_exp = int((i) ** 3)
            elif self.growth_rate == 'GROWTH_MEDIUM_SLOW':
                next_level_exp = int((6/5) * (i) ** 3 - 15 * (i) ** 2 + 100 * (i) - 140)
            else:
                next_level_exp = int((5/4) * (i) ** 3)
        return next_level_exp
    
    def find_next_level_exp(self):
        if self.growth_rate == 'GROWTH_FAST':
            next_level_exp = int(0.8 * (self.level + 1) ** 3)
        elif self.growth_rate == 'GROWTH_MEDIUM_FAST':
            next_level_exp = int((self.level + 1) ** 3)
        elif self.growth_rate == 'GROWTH_MEDIUM_SLOW':
            next_level_exp = int((6/5) * (self.level + 1) ** 3 - 15 * (self.level + 1) ** 2 + 100 * (self.level + 1) - 140)
        else:
            next_level_exp = int((5/4) * (self.level + 1) ** 3)
        return next_level_exp

    def add_exp(self, experience):
        self.exp += experience
        while self.exp >= self.next_level_exp:
            self.level_up()
            self.next_level_exp = self.find_next_level_exp()
    
    def evolve(self):
        if self.name.lower() == self.species:
            self.name = pokemon_build_data[self.evolves_to]['name'].title()
        build = pokemon_build_data[self.evolves_to]
        self.types = build['types']
        self.catch_rate = build['catch_rate']
        self.front_pic = build['front_pic']
        self.back_pic = build['back_pic']
        self.growth_rate = build['growth_rate']
        self.tmhm_learnset = build['tmhm_learnset']
        self.species = build['name']
        self.hp, self.attack, self.defense, self.speed, self.special = build['base_stats']
        self.evolution_level = build['evolution_level']
        self.evolves_to = build['evolves_to']
        self. next_level_exp = self.find_next_level_exp()

    def level_up(self):
        self.hp = int((((self.hp + self.hp_iv) * 2 + (self.ev / 4)) * self.level / 100) + 5)
        self.attack = int((((self.attack + self.attack_iv) * 2 + (self.ev / 4)) * self.level / 100) + 5)
        self.defense = int((((self.defense + self.defense_iv) * 2 + (self.ev / 4)) * self.level / 100) + 5)
        self.speed = int((((self.speed + self.speed_iv) * 2 + (self.ev / 4)) * self.level / 100) + 5)
        self.special = int((((self.special + self.special_iv) * 2 + (self.ev / 4)) * self.level / 100) + 5)
        self.level += 1
        if self.evolves_to and type(self.evolution_level) == int and self.level >= self.evolution_level:
            self.evolve()

